import AddTempModal from "./components/AddTempModal";
import { Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Card,
    CardBody,
    Nav,
    NavItem,
    NavLink,
    Container,
    Row,
    Col,
    Jumbotron,
    Button } from 'reactstrap';
import React, { Component } from 'react';
    class App extends Component {
      constructor(props) {
          super(props);
          this.toggleModal = this.toggleModal.bind(this);
          this.state = {
              isOpen: false
          };
      }
      toggleModal() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }
}

 function Save () {
    return <div>
         <AddTempModal toggle={this.toggleModal} isOpen={this.state.isOpen}  ></AddTempModal>
    <Jumbotron>
        <Container>
            <Row>
                 <Col>
                    <h1>continue working</h1>
                        <p>
                        <div>
                             <Card>
                                    <CardBody>
    <div classNameName="card hoverable"/>
    <div classNameName="card-content"/>
    <span className="card-title"><strong>My template</strong></span>
    <br/>
    <div className="card-action">
    <Button className="btn cyan darken-4 waves-effect waves-red" id="finishBtn">Update and Save Information</Button>
    </div>
                                </CardBody>
                            </Card>
                        </div>
                    </p>
                </Col>
            </Row>
        </Container>
    </Jumbotron>
    </div>
 }


export default Save;
